function getListOther()
{
    global $url;
    global $db;
    foreach($url as $tmp_url) {
        $preg_url = '#/tag_id/(.*)/#iU';
        preg_match($preg_url, $tmp_url, $tag_id);
        $tag_id = $tag_id[1];

        $content = file_get_contents($tmp_url);
        $content = json_decode($content, true);
        $contents = $content['data'];
        foreach($contents as $content){

            $result = $db->select("course_list", ['book_id' => $content['book_id'],'category_id' => $tag_id])->fetchAllArray();
            if(isset($result[0]['id'])){
                continue;
            }
            $arr = [
                'category_id'       => $tag_id,
                'book_id'           => $content['book_id'],
                'book_name'         => $content['book_name'],
                'book_idstr'        => $content['book_idstr'],
                'fit_age_begin'     => $content['fit_age_begin'],
                'fit_age_end'       => $content['fit_age_end'],
                'lflag'              => $content['lflag'],
                'cover_url'          => $content['cover_url']
            ];
            $id = $db->insert('course_list', $arr);

            foreach($content['tags'] as $tag){
                $db->insert('course_tag', [
                    'course_id' => $id,
                    'tag'        => $tag['tag_name']
                ]);
            }
        }

    }
    echo 'ok!';exit;

}

function updateList()
{
    global $content_url2;
    global $db;

    foreach($content_url2 as $url){
        $content = file_get_contents($url);
        $content = json_decode($content,true);
        if(isset($content['data']['book_id'])){
            $content = $content['data'];
            $result = $db->select("course_list", ['book_id' => $content['book_id']])->fetchAllArray();
            if($result[0]['sound_url'] && $result[0]['sound_url'] != ""){
                continue;
            }
            $db->update( 'course_list', [
                'book_excerpt' => $content['book_excerpt'],
                'book_author' => $content['book_author'],
                'series_id' => $content['series_id'],
                'sound_url' => $content['sound_url'],

            ], ['book_id' => $content['book_id']] );

            foreach($content['pagelist'] as $pageList){
                $db->insert('course_page_list', [
                    'book_id'   => $content['book_id'],
                    'sound_begin' => $pageList['sound_begin'],
                    'sound_end' => $pageList['sound_end'],
                    'page_url' => $pageList['page_url'],
                ]);
            }
        }
    }
    echo 'ok!';exit;

}

function saveList()
{
    global $category_content;
    global $db;
    foreach($category_content as $key => $content){
        $contents = json_decode($content,true);

        $contents = $contents['data'];
        foreach($contents as $content){

            $arr = [
                'category_id'       => $key,
                'book_id'           => $content['book_id'],
                'book_name'         => $content['book_name'],
                'book_idstr'        => $content['book_idstr'],
                'fit_age_begin'     => $content['fit_age_begin'],
                'fit_age_end'       => $content['fit_age_end'],
                'lflag'              => $content['lflag'],
                'cover_url'          => $content['cover_url']
            ];
            $id = $db->insert('course_list', $arr);

            foreach($content['tags'] as $tag){
                $db->insert('course_tag', [
                    'course_id' => $id,
                    'tag'        => $tag['tag_name']
                ]);
            }
        }
    }
    echo 'ok!';

}

function saveCategory($category){


    $category = json_decode($category,true);

    $category = $category['data'];

    global $db;
    $tmp = [];
    foreach($category as $row){
        $tmp['category_id'] = $row['tag_id'];
        $tmp['category_name'] = $row['tag_name'];
        $db->insert('course_category', $tmp);
    }


    echo 'ok';
}


